import torch
import torch.nn as nn
from torch.utils.cpp_extension import load_inline

# Define the custom CUDA kernel for matrix multiplication using cuBLAS
matmul_cuda_source = """
#include <torch/extension.h>
#include <cuda_runtime.h>
#include <cublas_v2.h>

torch::Tensor matmul_cuda(torch::Tensor A, torch::Tensor B) {
    // Get dimensions
    int N = A.size(0);

    // Create output tensor
    auto C = torch::zeros({N, N}, A.options());

    // Get pointers to tensor data
    const float *A_data = A.data_ptr<float>();
    const float *B_data = B.data_ptr<float>();
    float *C_data = C.data_ptr<float>();

    // Initialize cuBLAS
    cublasHandle_t handle;
    cublasCreate(&handle);

    // Set up alpha and beta for gemm
    float alpha = 1.0f;
    float beta = 0.0f;

    // Perform matrix multiplication using cuBLAS
    // cuBLAS uses column-major order, so we need to compute B^T * A^T = (A * B)^T
    cublasSgemm(handle, CUBLAS_OP_N, CUBLAS_OP_N, 
                N, N, N, 
                &alpha,
                B_data, N,  // B transposed
                A_data, N,  // A transposed
                &beta,
                C_data, N);

    // Clean up
    cublasDestroy(handle);

    return C;
}
"""

matmul_cpp_source = """
torch::Tensor matmul_cuda(torch::Tensor A, torch::Tensor B);
"""

# Compile the custom CUDA kernel
matmul_module = load_inline(
    name="matmul_cuda",
    cpp_sources=matmul_cpp_source,
    cuda_sources=matmul_cuda_source,
    functions=["matmul_cuda"],
    extra_ldflags=["-lcublas"],
    verbose=True
)

class ModelNew(nn.Module):
    """
    Optimized model that performs a single square matrix multiplication (C = A * B)
    using cuBLAS for maximum performance
    """
    def __init__(self):
        super(ModelNew, self).__init__()

    def forward(self, A: torch.Tensor, B: torch.Tensor) -> torch.Tensor:
        """
        Performs the matrix multiplication using cuBLAS.

        Args:
            A (torch.Tensor): Input matrix A of shape (N, N).
            B (torch.Tensor): Input matrix B of shape (N, N).

        Returns:
            torch.Tensor: Output matrix C of shape (N, N).
        """
        # Make sure tensors are on GPU and have the right format
        if not A.is_cuda:
            A = A.cuda()
        if not B.is_cuda:
            B = B.cuda()

        A = A.contiguous()
        B = B.contiguous()

        # Use cuBLAS for matrix multiplication
        return matmul_module.matmul_cuda(A, B)
